    to the Commission's request, dated April 7, 2011.    1.  An amended Form 1 has
    been submitted to correct the treasurer information.    2.  The contributions
    made to Conway for Senate after the election were to retire debt and have now
    been labeled as such.    3.  The items in question on Schedule A, support Line
    15, are not receipts for goods or services, but rather vendor refunds.  They are
    labeled as such.    4.  The Summary Page totals have been corrected through this
    amendment.    5.  The transfer from DSP was mis-reported and has now been corrected.
    \   6.  All travel, reported on Schedule H4, has been properly itemized.    7.
    \ Schedule F should now report the Candidate name appropriately.  This was a software
    error.    8.  The item listed on Schedule F after the election was for an item
    that the Committee did not realize was due and the invoice was received after
    the election.  The item was then reported when the invoice was received and paid.
    \ Any payroll related expense on Schedule H4 was for the benefit of employees
    that did not spend over 25% of their compensated time on federal election activity.
    Any receipts on Schedule A, supporting LIne 17, for Voter File Access, were charged
    at the Usual and Normal Charge, previously established with the FEC.\n"
